import React from 'react';
let arr =[]
function Images({array}){


  let imagesArray=  array.map( (x) => {
        return(
        <a 
            key={x.id} 
            href={x.links.html} 
            target={'_blank'} >
                <img 
                     src={x.urls.regular} 
                    alt={x.alt_description} 
                    title={x.alt_description}  />
         </a>)
    });
    arr=arr.concat(imagesArray);
    console.log(arr)
    return(
    <div className="image-container shadow-6 mh8">
        {arr}
    </div>
    );
}




export default Images;
